DROP TABLE IF EXISTS `fa_user`;
CREATE TABLE `fa_user` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `bianhao` char(10) DEFAULT NULL COMMENT '身份编码',
  `group_id` int(10) unsigned NOT NULL DEFAULT '1' COMMENT '组别ID',
  `username` varchar(32) DEFAULT '' COMMENT '用户名',
  `nickname` varchar(50) DEFAULT '' COMMENT '昵称',
  `password` varchar(32) DEFAULT '' COMMENT '密码',
  `salt` varchar(30) DEFAULT '' COMMENT '密码盐',
  `email` varchar(100) DEFAULT '' COMMENT '电子邮箱',
  `mobile` varchar(11) DEFAULT '' COMMENT '手机号',
  `usdt` decimal(12,4) NOT NULL DEFAULT '0.0000' COMMENT 'USDT',
  `usdt_dj` decimal(12,4) NOT NULL DEFAULT '0.0000' COMMENT 'USDT冻结',
  `avatar` varchar(255) DEFAULT '' COMMENT '头像',
  `sfz_fimage` varchar(100) DEFAULT NULL COMMENT '身份证人像面',
  `sfz_bimage` varchar(100) DEFAULT NULL COMMENT '身份证国徽面',
  `sfz_pimage` varchar(100) DEFAULT '' COMMENT '手持身份证',
  `successions` int(10) unsigned NOT NULL DEFAULT '1' COMMENT '连续登录天数',
  `maxsuccessions` int(10) unsigned NOT NULL DEFAULT '1' COMMENT '最大连续登录天数',
  `prevtime` bigint(16) DEFAULT NULL COMMENT '上次登录时间',
  `logintime` bigint(16) DEFAULT NULL COMMENT '登录时间',
  `loginip` varchar(50) DEFAULT '' COMMENT '登录IP',
  `loginfailure` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '失败次数',
  `joinip` varchar(50) DEFAULT '' COMMENT '加入IP',
  `jointime` bigint(16) DEFAULT NULL COMMENT '加入时间',
  `createtime` bigint(16) DEFAULT NULL COMMENT '创建时间',
  `updatetime` bigint(16) DEFAULT NULL COMMENT '更新时间',
  `token` varchar(50) DEFAULT '' COMMENT 'Token',
  `status` enum('normal','check','hidden') DEFAULT 'check' COMMENT '状态:normal=正常,hidden=隐藏,check=审核',
  `verification` varchar(255) DEFAULT '' COMMENT '验证',
  `invite` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '邀请人',
  `google_secret` varchar(50) DEFAULT NULL COMMENT '谷歌密钥',
  `sfz_status` enum('0','1','2') NOT NULL DEFAULT '0' COMMENT '身份证认证:0=待上传,1=已认证,2=待审核',
  `paypwd` varchar(32) DEFAULT NULL COMMENT '支付密码',
  `sparent` varchar(255) DEFAULT NULL COMMENT '父亲集合',
  `teamid` varchar(10) DEFAULT NULL COMMENT '团队ID',
  `access_key` char(10) DEFAULT NULL COMMENT 'access_key',
  `diqu` smallint(5) DEFAULT '1' COMMENT '限制地区:1=大陆,2=新疆,3=海外',
  `pay_status` enum('normal','hidden') DEFAULT 'hidden' COMMENT '收银台:normal=开启,hidden=关闭',
  `pay_sort` int(10) DEFAULT '999' COMMENT '支付排序',
  `agent_group_id` int(10) DEFAULT '0' COMMENT '公司团队id',
  `min_cny` decimal(10,2) DEFAULT '0.00' COMMENT '最低金额',
  `max_cny` decimal(10,2) DEFAULT '10000.00' COMMENT '最高金额',
  `trust` tinyint(1) DEFAULT '2' COMMENT '信任用户:1=是,2=否',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `username` (`username`) USING BTREE,
  KEY `email` (`email`) USING BTREE,
  KEY `mobile` (`mobile`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=168040 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='会员表';

